import React from "react";

function BreadcrumbBar({ nav1 = "nav1", nav2 = false }) {
  return (
    <>
      <nav aria-label="breadcrumb">
        <ol className="breadcrumb">
          <li className="breadcrumb-item" aria-current="page">
            Home
          </li>
        </ol>
      </nav>
    </>
  );
}

export default BreadcrumbBar;
